class Solution:    def lengthOfLIS(self, nums):        """        :type nums: List[int]        :rtype: int        """        res=[]        for num in nums:            if not res or num > res[-1]:                res.append(num)            else:                for i in range(len(res) - 2, -1, -1):                    if res[i] < num:                        res[i + 1] = num                        break                if i == -1:                    res[0] = num                        return len(res)